import React from 'react'
import "../CSS/Mcq.css"
import Header from "../components/header";

export default function mcq() {
  return (
    <div>
        <Header/>
        <div className="outer-container">
            <div className="top-layer row">
            <div className="col-5"><h2 className="quiz-name">Name of Quiz</h2></div>
            <div className="col-3"><h2 className="time-tag">Time Left</h2></div>
            </div>
        </div>
    </div>
  )
}
